%spark
import collection.JavaConverters._
import de.qaware.mlwb.impl.sparksolr.MetricsServiceImpl

val metricsQueryService = new MetricsServiceImpl.Factory(sqlc).getInstance("192.168.1.100:2181", "ekgdata")
val query = new QueryMetricContext.Builder().withHost("lp*").withStart(Timestamp.valueOf("2015-09-28 00:00:00")).withEnd(Timestamp.valueOf("2015-10-04 00:00:00")).build()

val counters = metricsQueryService.getCounters(query, Granularity.NONE, AggregationType.MIN).filter(inRange(_))

val constantNames = counters.flatMap(c => {
    val vals = c.getValuePoints.asScala.dropWhile(_.getValue == -1)
    if (vals.isEmpty) {
        Iterator(c.getMetric.getName + " [series," + c.getMetric.getProcs + "," + c.getMetric.getHost + "]")
    } else {
        val ref = vals.head.getValue
        // val deviates from reference -> no constant
        if (vals.exists(v => (v.getValue != ref) && (v.getValue != -1))){
            Iterator()
        } else {
            Iterator(c.getMetric.getName + " [series," + c.getMetric.getProcs + "," + c.getMetric.getHost + "]")
        }
    }
})

// Cache table because it is rather small but computation is expensive (~9k elements)
constantNames.createOrReplaceTempView("constantNames")
sqlc.cacheTable("constantNames")
constantNames.count

