import java.sql.Timestamp
import de.qaware.mlwb.api._
import org.apache.spark.sql.Encoders
import collection.JavaConverters._
import de.qaware.mlwb.impl.sparksolr.MetricsServiceImpl
import scala.collection.mutable.ListBuffer

val start = Timestamp.valueOf("2014-11-29 00:00:00")
val end = Timestamp.valueOf("2015-10-03 00:00:00")

object Context {
    val start = Timestamp.valueOf("2014-11-29 00:00:00")
    val end = Timestamp.valueOf("2015-10-03 00:00:00")
}

// In range filters metrics so only those which are completely in range qualify
def inRange(c: Counter): Boolean = {
    val head = c.getValuePoints.get(0).getDate
    val tail = c.getValuePoints.get(c.getValuePoints.size - 1).getDate
    return (head.before(Context.start) || head.equals(Context.start)) && (tail.after(Context.end) || tail.equals(Context.end))
}

def restartSeqs(c: Counter): Tuple3[String, String, List[Tuple2[Timestamp,Timestamp]]] = {
    val vps = c.getValuePoints

    var result = new ListBuffer[Tuple2[Timestamp, Timestamp]]
    var lastUptime = vps.get(0)
    for (i <- 1 until vps.size) {
        val elem = vps.get(i)
        if (elem.getValue != -1) {
            if (elem.getValue < lastUptime.getValue) {
                result.append(Tuple2(new Timestamp(lastUptime.getDate.getTime + 60*1000), new Timestamp(elem.getDate.getTime - 60*1000)))
            }
            lastUptime = elem
        }
    }

    (c.getMetric.getHost, c.getMetric.getProcs, result.toList)
}

service.getCounters(query, Granularity.MINUTE, AggregationType.MIN).map(c => restartSeqs(c)).collect.foreach(println(_))
